import './App.css';
import Navbar from './components/navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">

      <BrowserRouter>
          <Navbar/>
        <Routes>
          <Route path='/' element = {<Shop/>}/>
          <Route path='/meat' element = {<ProductCategory/>}/>
          <Route path='/eggs' element = {<ProductCategory/>}/>
          <Route path='/tools' element = {<ProductCategory/>}/>  
        </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
